export declare const gqlHomesConsumption = "\nquery getConsumption($resolution: EnergyResolution! $lastCount:Int!){\n  viewer {\n    homes {\n      id\n      consumption(resolution: $resolution, last: $lastCount) {\n        nodes {\n          from\n          to\n          cost\n          unitPrice\n          unitPriceVAT\n          consumption\n          consumptionUnit\n          totalCost\n          unitCost\n          currency\n        }\n      }\n    }\n  }\n}\n";
export declare const gqlHomeConsumption = "\nquery getConsumption($homeId:ID! $resolution: EnergyResolution! $lastCount:Int!){\n  viewer {\n    home(id:$homeId) {\n      id\n      consumption(resolution: $resolution, last: $lastCount) {\n        nodes {\n          from\n          to\n          cost\n          unitPrice\n          unitPriceVAT\n          consumption\n          consumptionUnit\n          totalCost\n          unitCost\n          currency\n        }\n      }\n    }\n  }\n}\n";
